import { Route, Routes } from "react-router-dom";

import Signin from "./Components/Pages/Signin";
import Signup from "./Components/Pages/Signup";
import Home from "./Components/Pages/Main";
import ProjectsPath from "./Components/Pages/Projects/ProjectsPaths";
import Projects from "./Components/Pages/Projects/AllProjects";
import AddProjects from "./Components/Pages/Projects/AddProjects";
import Navbar from "./Components/Navbar";
import Scrollup from "./Components/Scrollup";

import "./App.css";

// import { useState } from "react";
// import AddProjects from "./Components/Pages/Projects/AddProjects/index";

function App() {
  // const [project, setProject] = useState({});
  return (
    <div className="app">
      {/* <Navbar /> */}
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route exact path="/signin" element={<Signin />} />
        <Route exact path="/signup" element={<Signup />} />
        <Route exact path="/projects" element={<Projects />} />

        {/* <Route path="/projects" element={<ProjectsPath />} /> */}
        <Route exact path="/projects/:type" element={<Projects />} />
        <Route exact path="/addProject" element={<AddProjects />} />

        {/* <Route path="/projects" element={<AddProjects setProjectName={setProject} />} /> */}
      </Routes>
      {/* <AddProjects setProject={setProject} />; */}
      <Scrollup />
    </div>
  );
}

export default App;
